import React from "react";
import { Routes, Route, Link } from "react-router-dom";

function News() {
  return (
    <div>
      <h1>News</h1>
      <ul>
        <li>
          <Link to="/news1"> News 1</Link>
        </li>
        <li>
          <Link to="/news2"> News 2</Link>
        </li>
      </ul>
      <Routes>
        <Route path="/news1"/>
      </Routes>
    </div>
  );
}

export default News;
